class Solution:
    def get_length(self, s: str):
        myset = set()
        for i in range(len(s)):
            if s[i] in myset:
                return i
            myset.add(s[i])
        return len(s)

    def lengthOfLongestSubstring(self, s: str):
        if len(s) == 0:
            return 0

        max_len = 0
        for i in range(len(s)):
            ret = self.get_length(s[i:])
            if ret > max_len:
                max_len = ret
            if len(s) - i < max_len:
                return max_len
        return max_len


